import './App.css';
import Appbar from "./components/Appbar";
import Person from "./components/Person";
import React from "react";

import bers from "./img/bers.jpg"

function App() {
  return (
    <React.Fragment style={{backgroundImage:`url(${bers})`, backgroundRepeat:"no-repeat", backgroundSize:"cover", height:"100%"}}>
    <Appbar/>
    <Person/>
    </React.Fragment>
  );
}

export default App;
